function ExpenseAmount(props) {
  const amountArray = [
    props.expenses[0].amount,
    props.expenses[1].amount,
    props.expenses[2].amount,
    props.expenses[3].amount,
  ];
  const randomAmount =
    amountArray[Math.floor(Math.random() * amountArray.length)];
  return <div>{randomAmount}</div>;
}

export default ExpenseAmount;
